export default function PersonalSkills(langague: string) {
    const json = {
        'pt-br': {
            componentLabel: 'Habilidades',
            teste:{
                teste1: 'teste1',
                teste2: 'teste2',
                teste3: 'teste3',
            } 
        },
        'en': {
            componentLabel: 'Skills',
            teste:{
                teste1: 'teste1',
                teste2: 'teste2',
                teste3: 'teste3',
            }
        }
    };

        if (langague == 'eng') {
            return json['en'];
        }
        return json['pt-br'];
};
